import Header from './components/Header';
import Entry from './components/Entry';
import Entries from '/Users/alokwaigaonkar/travel_journal/src/data.js';

function App() {
  const entryElements=Entries.map((entry)=>{
    return <Entry 
    key={entry.id}
    entry={entry}
    />
  })
  return (
    <>
    <Header />
    {entryElements}
    </>
  );
}

export default App;
